import React from "react";
import FooterComponent from "./FooterComponent";
import HeaderComponent from "./HeaderComponent";

const Faq = () => {
    return (
        <div className="contenedor-productos p-0">
        <HeaderComponent/>
        <div>
            Preguntas frecuentes
        </div>
        <FooterComponent/>
        </div>
    );
;}

export default Faq;
